(function () {

  angular.module('ui.datepicker', [])

    .service('dateService', function () {

      var self = this;

      self.days = {
        1: 31,
        2: 29,
        3: 31,
        4: 30,
        5: 31,
        6: 30,
        7: 31,
        8: 31,
        9: 30,
        10: 31,
        11: 30,
        12: 31
      };

      var current_year = new Date().getFullYear();
      var arr = [];
      for (var i = 90; i > 0; i--) {
        arr.push(current_year - i);
      }

      self.years = arr.reverse();

      self.months = {
        en: {
          1: "January",
          2: "February",
          3: "March",
          4: "April",
          5: "May",
          6: "June",
          7: "July",
          8: "August",
          9: "September",
          10: "October",
          11: "November",
          12: "December"
        },
        ru: {
          1: "Январь",
          2: "Февраль",
          3: "Март",
          4: "Апрель",
          5: "Мая",
          6: "Июнь",
          7: "Июль",
          8: "Август",
          9: "Сентябрь",
          10: "Октябрь",
          11: "Ноябрь",
          12: "Декабрь"
        }
      };

      return this;

    })

    .directive('datePicker', ["dateService", function (dateService) {
      return {
        restrict: 'E',
        replace: true,
        templateUrl: '/html/ui/ui.datepicker.html',
        scope: {
          model: '=',
          lang: '=?',
          disabled: '=?'
        },
        link: function (scope) {

          scope.days = dateService.days;
          scope.months = scope.lang ? dateService.months['ru'] : (dateService.months[scope.lang] || dateService.months['ru']);
          scope.years = dateService.years;

          scope.range = function (start, end) {
            var result = [];
            for (var i = start; i <= end; i++) {
              result.push(i);
            }
            return result;
          };

        }
      }

    }]);


}());
(function () {

  angular.module('ui', [
    'angularUtils.directives.dirPagination',
    'ui.datepicker',
    'ui.menu',
    'ui.mask',
    'ngTouch'
  ])

    .directive('notifyPopup', function () {

      return {

        restrict: 'E',
        replace: false,
        templateUrl: '/html/ui/ui.notify.popup.html',
        scope: true,
        link: function (scope) {

          scope.data = null;

          scope.$on('notify:show', function (e, info) {
            scope.data = info;
          });

          scope.$on('notify:hide', function () {
            scope.data = null;
          });

        }

      }

    })

    .directive('scrollTo', function () {
      return {
        restrict: 'A',
        replace: false,
        scope: false,
        link: function (scope, el, attr) {

          var to = $(attr.scrollTo);
          var time = attr.scrollTime;

          $(el).on('click', function () {

            if (!to.length) return;

            var offset = to.offset().top + $(window).height() > $('body').height() ? $('body').height() - $(window).height() : to.offset().top;

            $("html, body").delay(100).animate({
              scrollTop: offset
            }, time || 500, function () {
              to.addClass('scrolled');
              setTimeout(function () {
                to.removeClass('scrolled')
              }, 1000)
            });

          })

        }
      }
    })

    .directive('spAuth', ["$rootScope", "sp", function ($rootScope, sp) {
      return {
        restrict: 'A',
        replace: false,
        scope: false,
        link: function (scope, el, attrs) {

          var opts = scope.$eval(attrs.spAuth);

          var options = {
            node: el[0]
          };

          angular.merge(options, opts);

          $rootScope.$on('login.remote', function () {

            sp.send('login.remote', options);

          });

          sp.config() && sp.config().partner && sp.send('login.remote', options);

        }
      }
    }])

    .directive('slackSlider', ["$compile", "$timeout", function ($compile, $timeout) {
      return {
        restrict: 'A',
        replace: false,
        scope: false,
        link: function (scope, el) {

          if (scope.$last) { // all are rendered

            // Issue!!! maybe some async
            $timeout(function () {

              $('.js-slick-slider').not('.slick-initialized').slick({
                adaptiveHeight: true,
                slidesToShow: 4,
                slidesToScroll: 1,
                arrows: true,
                prevArrow: '<span class="slick-left"></span>',
                nextArrow: '<span class="slick-right"></span>',
                speed: 150,
                infinite: false,
                swipeToSlide: true,
                dots: false,
                edgeFriction: 0.1,
                responsive: [
                  {
                    breakpoint: 1400,
                    settings: {
                      slidesToShow: 3,
                      slidesToScroll: 1
                    }
                  },
                  {
                    breakpoint: 1024,
                    settings: {
                      slidesToShow: 2,
                      slidesToScroll: 1
                    }
                  },
                  {
                    breakpoint: 700,
                    settings: {
                      slidesToShow: 1,
                      slidesToScroll: 1
                    }
                  }
                ]
              });

            }, 10);

          }

        }

      };
    }]);

}());

(function () {

  angular.module('ui.menu', [])

    .constant('menu_items', [
      {
        alias: null,
        name: 'Задания'
      },
      {
        alias: 'gifts',
        name: 'Подарки'
      },
      {
        alias: 'collections',
        name: 'Мои коллекции'
      },
      {
        alias: 'achievements',
        name: 'Мои достижения'
      }
    ])

    .directive('spTabMenu', ["menu_items", function (menu_items) {
      return {
        restrict: 'A',
        scope: false,
        link: function (scope) {
          scope.menu = angular.copy(menu_items);
        }
      }
    }]);


}());